import React, { Component } from 'react';

// Components
import Button from '../Button';
import Input from '../Input';

// Icons
import { MdCloudDownload, MdKeyboardArrowDown } from 'react-icons/md';

// Style
import { Container, Content, BackDrop, Login, Create } from './styles';

class Modal extends Component {
	render() {
		return (
			<Container>
				<BackDrop onClick={() => this.props.handleModal()} />
				<Content>
					<Login>
						<h3>Ark Existing Account</h3>
						<Input />
						<h3>Password</h3>
						<Input />
						<Button type="ark" label="Sign in" />
					</Login>
					<Create></Create>
				</Content>
			</Container>
		);
	}
}

export default Modal;
